export function FrameworkSelector() {
  const organization = useOrganization();
  const project = useProject();

  return (
    <PageGradient>
      <div className="mx-auto max-w-3xl">
        <Header1 className="">Create your first Job in minutes</Header1>
        <Paragraph spacing>Choose a framework to get started</Paragraph>
        <div className="grid grid-cols-3 items-center gap-2 divide-x">
          <Link to={projectSetupNextjsPath(organization, project)} className="">
            <NextjsLogo />
          </Link>
          <Link to={projectSetupRemixPath(organization, project)}>
            <RemixLogo />
          </Link>
          <Link to={projectSetupExpressPath(organization, project)}>
            <ExpressLogo />
          </Link>
          <Link to={projectSetupRedwoodPath(organization, project)}>
            <RedwoodLogo />
          </Link>
          <Link to={projectSetupAstroPath(organization, project)}>
            <AstroLogo />
          </Link>
          <Link to={projectSetupNuxtPath(organization, project)}>
            <NuxtLogo />
          </Link>
          <Link to={projectSetupSvelteKitPath(organization, project)}>
            <SvelteKitLogo />
          </Link>
          <Link to={projectSetupFastifyPath(organization, project)}>
            <FastifyLogo />
          </Link>
        </div>
      </div>
    </PageGradient>
  );
}

